create database housing;

use housing;

create table public_housing(
INSPECTION_ID int not null,
PUBLIC_HOUSING_AGENCY_NAME varchar(500),
COST_OF_INSPECTION_IN_DOLLARS int,
INSPECTED_DEVELOPMENT_NAME varchar(500),
INSPECTED_DEVELOPMENT_ADDRESS varchar(800),
INSPECTED_DEVELOPMENT_CITY varchar(50),
INSPECTED_DEVELOPMENT_STATE varchar(20),
INSPECTION_DATE varchar(30),
INSPECTION_SCORE int,
Primary key(INSPECTION_ID)
);


;


select * from public_housing limit 20;

SELECT
    PHA_NAME,
    MAX(DATE_FORMAT(MR_INSPECTION_DATE, '%m/%d/%Y')) AS MR_INSPECTION_DATE,
    MAX(MR_INSPECTION_COST) as MR_INSPECTION_COST,
    MAX(DATE_FORMAT(SECOND_MR_INSPECTION_DATE, '%m/%d/%Y')) AS SECOND_MR_INSPECTION_DATE,
    MAX(SECOND_MR_INSPECTION_COST) as SECOND_MR_INSPECTION_COST,
    MAX(CHANGE_IN_COST) as CHANGE_IN_COST,
    MAX(PERCENT_CHANGE_IN_COST) as PERCENT_CHANGE_IN_COST
FROM (
    SELECT
         m1.PHA_NAME,
        STR_TO_DATE( m1.INSPECTION_DATE, '%m/%d/%Y') AS MR_INSPECTION_DATE,
         m1.COST_OF_INSPECTION_IN_DOLLARS AS MR_INSPECTION_COST,
        STR_TO_DATE( m2.INSPECTION_DATE, '%m/%d/%Y') AS SECOND_MR_INSPECTION_DATE,
         m2.COST_OF_INSPECTION_IN_DOLLARS AS SECOND_MR_INSPECTION_COST,
        ( m2.COST_OF_INSPECTION_IN_DOLLARS -  m1.COST_OF_INSPECTION_IN_DOLLARS) AS CHANGE_IN_COST,
        (( m2.COST_OF_INSPECTION_IN_DOLLARS -  m1.COST_OF_INSPECTION_IN_DOLLARS) /  m1.COST_OF_INSPECTION_IN_DOLLARS) * 100 AS PERCENT_CHANGE_IN_COST
    FROM (
        SELECT
            PUBLIC_HOUSING_AGENCY_NAME as PHA_NAME,
            INSPECTION_DATE,
            COST_OF_INSPECTION_IN_DOLLARS
        FROM public_housing
    ) AS m1
    JOIN (
        SELECT
            PUBLIC_HOUSING_AGENCY_NAME as PHA_NAME,
            INSPECTION_DATE,
            COST_OF_INSPECTION_IN_DOLLARS
        FROM public_housing
    ) AS m2
    ON m1.PHA_NAME = m2.PHA_NAME
    WHERE STR_TO_DATE(m1.INSPECTION_DATE, '%m/%d/%Y') < STR_TO_DATE(m2.INSPECTION_DATE, '%m/%d/%Y')
) AS subquery
WHERE CHANGE_IN_COST > 0
GROUP BY PHA_NAME;


WITH RankedInspections AS (
    SELECT
        PUBLIC_HOUSING_AGENCY_NAME AS PHA_NAME,
        STR_TO_DATE(INSPECTION_DATE, '%m/%d/%Y') AS MR_INSPECTION_DATE,
        COST_OF_INSPECTION_IN_DOLLARS AS MR_INSPECTION_COST,
        LEAD(STR_TO_DATE(INSPECTION_DATE, '%m/%d/%Y')) OVER (PARTITION BY PUBLIC_HOUSING_AGENCY_NAME ORDER BY STR_TO_DATE(INSPECTION_DATE, '%m/%d/%Y')) AS SECOND_MR_INSPECTION_DATE,
        LEAD(COST_OF_INSPECTION_IN_DOLLARS) OVER (PARTITION BY PUBLIC_HOUSING_AGENCY_NAME ORDER BY STR_TO_DATE(INSPECTION_DATE, '%m/%d/%Y')) AS SECOND_MR_INSPECTION_COST
    FROM public_housing
)
, ChangeInCost AS (
    SELECT
        PHA_NAME,
        MR_INSPECTION_DATE,
        MR_INSPECTION_COST,
        SECOND_MR_INSPECTION_DATE,
        SECOND_MR_INSPECTION_COST,
        (SECOND_MR_INSPECTION_COST - MR_INSPECTION_COST) AS CHANGE_IN_COST,
        ((SECOND_MR_INSPECTION_COST - MR_INSPECTION_COST) / MR_INSPECTION_COST) * 100 AS PERCENT_CHANGE_IN_COST
    FROM RankedInspections
    WHERE SECOND_MR_INSPECTION_DATE IS NOT NULL
      AND (SECOND_MR_INSPECTION_COST - MR_INSPECTION_COST) > 0
)
SELECT
    PUBLIC_HOUSING_AGENCY_NAME as PHA_NAME,
    MAX(MR_INSPECTION_DATE) AS MR_INSPECTION_DATE,
    MAX(MR_INSPECTION_COST) AS MR_INSPECTION_COST,
    MAX(SECOND_MR_INSPECTION_DATE) AS SECOND_MR_INSPECTION_DATE,
    MAX(SECOND_MR_INSPECTION_COST) AS SECOND_MR_INSPECTION_COST,
    MAX(CHANGE_IN_COST) AS CHANGE_IN_COST,
    MAX(PERCENT_CHANGE_IN_COST) AS PERCENT_CHANGE_IN_COST
FROM public_housing
GROUP BY PHA_NAME;


 